import React from 'react';
import Rainbow from '../hoc/Rainbow';
import './Rings.css';

const Rings = (props) => {
	// console.log(props);
	// setTimeout(() => {
	// 	  props.history.push("/about");
	// 	}, 2000);

	return (
		<div>
			<div className="container">
				<h4 className="center">Rings</h4>
				<div className='aaa'><img src={require("./yüzükimg/1y.jpeg")}></img></div>
                <div className='aaa'><img src={require("./yüzükimg/2y.jpeg")}></img></div>
                <div className='aaa'><img src={require("./yüzükimg/3y.jpg")}></img></div>
                <div className='aaa'><img src={require("./yüzükimg/4y.jpeg")}></img></div>
                <div className='aaa'><img src={require("./yüzükimg/5y.jpg")}></img></div>
                <div className='a'><button className="btn grey">
						Sepete Ekle
					</button></div>
			</div>
		</div>
	)
}


export default Rainbow(Rings);
